@fdwr it was on ORT version 1.11.1. Just tested, works as expected with the 1.12 release candidate.

I did not get any errors running just CPU... I guess the CPU fallback wasn't working correctly. Happy to provide more info if you want to debug it, but if it's fixed going forward I can just use 1.12.

Thanks for the example code of how to use DirectML w/ ORT by the way (https://github.com/fdwr/OnnxRuntimeDirectMLEPSample). It's been super helpful for me :)
